import React from 'react'

const Footer = () => {
  return (
      <footer>
        <div className="footer-container">
          <div className="footer-section">
            <a href="http://localhost:3000/reservations_admin">Reservations Administration</a>
          </div>
        </div>
      </footer>
  )
}

export default Footer;
